Decades ago, Congress voted to authorize the executive branch to cancel federal student loans.
 
Federal student debt can be canceled with the flick of a pen.
 
@POTUS must use his authority to cancel student debt and provide millions with badly needed relief.

Canceling $50,000 in student loan debt per borrower would increase the wealth of Black Americans by 40%.

Let’s be clear, the student loan debt crisis is a racial justice issue.

@POTUS it’s time to cancel it.

Student loan payments resume in less than 100 days.  

The pause on student loan payments has allowed millions of borrowers to start a business, participate in our economy, and save for the future.  

@POTUS must use his authority and cancel student debt.

